import "../styles/navbar.css";

const Header = () => {
  return (
    <div>
      <header className="header">



        <img className="log" src={Logo} alt="QUIZ" />
          <div className="top">
            <a href="/Login" className="l">
              Login
            </a>
            <a href="SignUp" className="S">Sign Up</a>

          </div>


      </header>
    </div>
  );
};

export default Header;
